import React from 'react';

class News extends React.Component {
    constructor(props){
        super();
    }
    render () {
        const {
            author,
            story_title
        } = this.props.news;
        return(
            <div className="news">
                <p className="author">{author}</p>
                <p className="storyTitle">{story_title}</p>
            </div>
        );
    }
}

export default News;
